function Weapon(ground, helo, air, acc, stab, ap, he, rof, supp, tags, rounds, name)
{"use strict";
    this.sName = name;
    this.sRoundType = rounds;
    this.rGround = ground;
    this.rHelo = helo;
    this.rAir = air;
    this.iAccuracy = acc;
    this.iStab = stab;
    this.AP = ap;
    this.HE = he;
    this.ROF = rof;
    this.iSuppression = supp;
    this.sTags = tags;
	this.iAmmo = 0;
}
	
var WeaponPack = [];


function Arm(id, ammo)
{"use strict";
    WeaponPack[id].iAmmo = ammo;
    return WeaponPack[id];
}

